import React from "react";


class PrototypeContainer extends React.Component {
    state = {
        university: []
    }

    componentDidMount() {
        fetch("https://maps.googleapis.com/maps/api/place/findplacefromtext/json?input=Museum%20of%20Contemporary%20Art%20Australia&inputtype=textquery&fields=photos,formatted_address,name,rating,opening_hours,geometry&key=AIzaSyC1ucluPOje2LzYoF5hnN2M9PvnKSYurQg")
            .then(response => response.json())
            .then(results => {
                console.log(results)
                this.setState({
                    university: results.candidates
                })
            })
    }
    render(){
        return (
            <div>
                {this.state.university.formatted_address}
            </div>
        )
    }
}


export default PrototypeContainer
